CREATE DEFINER=`root`@`localhost` PROCEDURE `getCosts` (IN `time` VARCHAR(10))   BEGIN


select
users.id,
users.userName as editorName,

year(register_logs.date) as year,
month(register_logs.date) as month,

users.hourlyPay,
users.currency,
count(*) as workDays,
count(*) * 8 as workHours,
sum(users.hourlyPay) * 8 as cost



from register_logs
left join users on users.id = register_logs.editor
where  register_logs.date like concat("%",time,"%")
and register_logs.type = 1

and users.id is not null

group by concat(users.id, year(register_logs.date), month(register_logs.date) )
order by users.userName ,register_logs.date
;


END$$

